///#source 1 1 /Scripts/changeView.js
function switchView() {
    var x = getCookie("view");

    if (x == "list") {
        deleteCookie("view");
        setCookie("view", "grid");
        location.reload();
        return false;
    }

    if (x == "grid") {
        deleteCookie("view");
        setCookie("view", "list");
        location.reload();
        return false;
    }
}
////////////////////////////////////////
function setView() {
    var x = getCookie("view");
    if (x == "grid") {
        $(".content").toggleClass("grid", true);
    }
    if (x == "list") {
        $(".content").toggleClass("grid", false);
    }

    if (x == undefined) {
        setCookie("view", "list");
        location.reload();
    }
}
///////////////////////////////////////
function setCookie(name, value, options) {
    options = options || {};

    var expires = options.expires;

    if (typeof expires == "number" && expires) {
        var d = new Date();
        d.setTime(d.getTime() + expires * 1000);
        expires = options.expires = d;
    }
    if (expires && expires.toUTCString) {
        options.expires = expires.toUTCString();
    }

    value = encodeURIComponent(value);
    var updatedCookie = name + "=" + value;

    for (var propName in options) {
        updatedCookie += "; " + propName;
        var propValue = options[propName];
        if (propValue !== true) {
            updatedCookie += "=" + propValue;
        }
    }
    document.cookie = updatedCookie;
}

function getCookie(name) {
    var matches = document.cookie.match(new RegExp(
      "(?:^|; )" + name.replace(/([\.$?*|{}\(\)\[\]\\\/\+^])/g, '\\$1') + "=([^;]*)"
    ));
    return matches ? decodeURIComponent(matches[1]) : undefined;
}

function deleteCookie(name) {
    setCookie(name, "", {
        expires: -1
    });
}





///#source 1 1 /Scripts/registrationDdl.js
$(document).ready(function () {

    $("#organization").change(function () {
        if ($("#organization option:selected").text() == "Select a Organization") {
            $(".ddl").toggleClass("hidden", true);
        } else {
            $(".ddl").toggleClass("hidden", false);
        }
        $("#department").empty();
        $.ajax({
            type: 'POST',
            url: getDepartmentsAction,
            dataType: 'json',
            data: { id: $("#organization").val() },
            success: function (states) {
                $.each(states, function (i, state) {
                    $("#department").append('<option value="' + state.Value + '">' + state.Text + '</option>');
                });
            },
            error: function (ex) {
                alert('Failed to retrieve states.' + ex);
            }
        });
        return false;
    });
});
